import React, { Component } from 'react';

class HomeContainer extends Component {
  handleClick = () => {
    debugger
  }
  render(){
    return (
      <div>
        hello from home

        <p onClick={handleClick}>test</p>
      </div>
    )
  }
}

export default HomeContainer;
